import React, { Suspense } from 'react';
import { Route, Switch } from 'react-router-dom';

const Grupos = React.lazy(() => import('./Grupos'));
const Rounds = React.lazy(() => import('./Rounds'));

const Buttons = () => (
  <Suspense fallback={<div>Loading...</div>}>
    <Switch>
      <Route path="/champions/grupos" component={Grupos} />
      <Route path="/champions/round" component={Rounds} />
    </Switch>
  </Suspense>
);

export default Buttons;
